    HomePage.prototype.addZeroes = function (num) {
        // If there is no decimal, or the decimal is less than 2 digits, toFixed
        if (num.split(".").length < 2) {
            num = num + '.00';
        }
        else if (num.split(".")[1].length < 2) {
            num = num + '0';
        }
        else if (num.split(".")[1].length >= 2) {
            num = parseFloat(num).toFixed(2);
        }
        // Return the number
        return num;
    };
