    AccountPage.prototype.loadData = function (data) {
        var _this = this;
        if (data != null && data != undefined) {
            this.modelsList = JSON.parse(data);
            for (var i = 0; i < this.modelsList.length; i++) {
                if (i > 1) {
                    this.items.push(i);
                    this.translateService.get(['proposed_tire']).subscribe(function (text) {
                        _this.titles.push(text['proposed_tire'] + i);
                    });
                }
            }
        }
    };
