    AccountPage.prototype.numberOnlyValidation = function (event) {
        var pattern = /[0-9.,]/;
        var inputChar = String.fromCharCode(event.charCode);
        if (!pattern.test(inputChar)) {
            // invalid character, prevent input
            event.preventDefault();
        }
    };
