    LifeCycleAnalysisPage.prototype.handleAddScenario = function () {
        var _this = this;
        this.translateService.get(['complete_scenario_alert', 'dismiss', 'cancel']).subscribe(function (text) {
            var alert = _this.alertCtrl.create({
                subTitle: text['complete_scenario_alert'],
                buttons: [{
                        text: text['dismiss'],
                        role: text['cancel'],
                        handler: function () {
                            if (_this.currentTab == 2) {
                                _this.addBackgroundColorToSecondLifeWhenDataisIncomplete();
                            }
                            else if (_this.currentTab == 1) {
                                _this.addBackgroundColorToFirstLifeWhenDataisIncomplete();
                            }
                        }
                    },]
            });
            alert.present();
        });
    };
