        //       this.myApp.getRootNav().setRoot(TabsResultPage, {trailerShow: this.trailerShow, nondrivenShow:this.nondrivenShow, proposedNum: this.items.length, isFromBasicAnalysis:false, data:this.modelListLifeCycle})
        //     }else{
